    private void makeNPCTeam() {
        ScoreboardManager scoreboardManager = Bukkit.getScoreboardManager();
        npcTeam = scoreboardManager.getMainScoreboard().getTeam("NPCs");
        if(npcTeam==null){
            npcTeam = scoreboardManager.getMainScoreboard().registerNewTeam("NPCs");
        }
        npcTeam.setOption(Team.Option.NAME_TAG_VISIBILITY, Team.OptionStatus.NEVER);
    }

