    public void startCitizensWalking(int i) {
        Random random = new Random();
        for (int j = 0; j < i; j++) {

            BukkitTask bukkitTask = new BukkitRunnable() {
                @Override
                public void run() {
                    startNPCWalk();
                }
            }.runTaskLater(mainManager, (20L * j)+100); // 100 ticks = 5 seconds
        }
    }

