    public Location getRandomStreetCorner(){
        Random random = new Random();
        int randomIndex = random.nextInt(streetCornerLocations.size());
        return streetCornerLocations.get(randomIndex);
    }
    public Location getRandomAdjacentStreetCorner(Location givenStreetCorner){
        Random random = new Random();
        int index = streetCornerLocations.indexOf(givenStreetCorner);
        if(random.nextBoolean()){
            if(index==0){
                index=streetCornerLocations.size();
            }
            index-=1;
        }else{
            index+=1;
            if(index==streetCornerLocations.size()){
                index=0;
            }
        }

        return streetCornerLocations.get(index);
    }


